Could be that this has something to do with mediawiki version. Here I have 1.18. All links in the generated eclipse help that should go back to the wiki server have wrong links. Changing WikitoDocTask.java like this solved it for me:

private String computeDefaultInternalLinkPattern() {
		String internalLinkPattern = wikiBaseUrl;
		if (!internalLinkPattern.endsWith("/")) { //$NON-NLS-1$
			internalLinkPattern += "/"; //$NON-NLS-1$
		}
		internalLinkPattern += "index.php?{0}"; //$NON-NLS-1$
		return internalLinkPattern;
	}

You see the inserted "index.php?". I suspect that this change is not usable in general. However it solves my problem.

Reproducible: Always

Steps to Reproduce:
1.create a mediawiki page with an internal link [[pagenname]]
2.convert to eclipse help
3.look at the generated html

Another change that I needed:

private String computeQualifiedWebPageUrl(String path) {
		String qualifiedUrl = wikiBaseUrl;
		if (!qualifiedUrl.endsWith("/")) { //$NON-NLS-1$
			qualifiedUrl += "/"; //$NON-NLS-1$
		}
		qualifiedUrl += "index.php?" + path;
		return qualifiedUrl;
	}

Here I added "index.php?" too to make links work.

This one is neccessary to workaround an exception when accessing wiki pages that have a colon ':' in name like all category pages. The exception occures when it tries to write the content to the file system and uses a filename with a colon. Here is a fix for writing (again WikitoDocTask.java) - might be access is impossible later - have think about it - however it does not fail completely at the moment you convert automatically pages belonging to a category and someone accidently adds a page with a colon in name (wiki namespace or something like this). This is important for me because of wiki conversion part of continues integration:

private File computeDestDir(Path path) {
		String name = path.name.replace(' ', '_').replaceAll("[:]", "%3A");
		String absolutePath = new File(name).getName();
		File dest = new File(this.dest, absolutePath);
		return dest;
	}
